          <div className="main__container__row__inp col-6">
            <input type="text" placeholder="type your name" />
            <input type="text" placeholder="type your price" />
            <input type="text" placeholder="type your image" />

            <button>add user</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Main;
